import Cookies from 'js-cookie'
import { Link } from 'react-router-dom'


const ProfilButton = () => {

  const id = Cookies.get('id')

  if(!id){
    return <li> <Link to="/users/me">Profil</Link></li>
  }else {
    <div></div>
  }

}


export default ProfilButton
